// routes.js

import React from 'react';
import { Router, Route } from 'react-router';
import {props} from 'prop-type';

import App from './App';

const Routes = (props) => (
  <Router {...props}>
    <Route path="/" component={ App }>
    </Route>
  </Router>
);

export default Routes;
